using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Net;
using System.Net.Sockets;
using System.Text;
using System.Threading.Tasks;
using System.Windows;
using System.Windows.Controls;
using System.Windows.Data;
using System.Windows.Documents;
using System.Windows.Input;
using System.Windows.Interop;
using System.Windows.Media;
using System.Windows.Media.Imaging;
using System.Windows.Navigation;
using System.Windows.Shapes;
using Path = System.IO.Path;

namespace MagicMirrorTest
{
    /// <summary>
    /// Interaction logic for MainWindow.xaml
    /// </summary>
    public partial class MainWindow : Window
    {

        Dictionary<String, List<String>> folders = new Dictionary<String, List<String>>();
        String[] dbgText = new String[2];
        private const String PORT = "8080";
        public MainWindow()
        {
            InitializeComponent();
            initVideoFiles();
            initWebServer();
            
        }

        private void initVideoFiles()
        {
            List<String> pumpkin = new List<String>();
            List<String> princess = new List<String>();
            List<String> skull = new List<String>();
            List<String> pirate = new List<String>();

            foreach (String file in Directory.GetFiles("movies/pumpkin", "*.mp4")) {
                string moviesName = Path.GetFileNameWithoutExtension(file);
                pumpkin.Add(moviesName);
            }

            foreach (String file in Directory.GetFiles("movies/princess", "*.mp4")) {
                string moviesName = Path.GetFileNameWithoutExtension(file);
                princess.Add(moviesName);
            }

            foreach (String file in Directory.GetFiles("movies/skull", "*.mp4")) {
                string moviesName = Path.GetFileNameWithoutExtension(file);
                skull.Add(moviesName);
            }

            foreach (String file in Directory.GetFiles("movies/pirate", "*.mp4")) {
                string moviesName = Path.GetFileNameWithoutExtension(file);
                pirate.Add(moviesName);
            }

            folders.Add("pumpkin", pumpkin);
            folders.Add("princess", princess);
            folders.Add("skull", skull);
            folders.Add("pirate", pirate);


        }

        private void initWebServer()
        {
            string localIP;
            using (Socket socket = new Socket(AddressFamily.InterNetwork, SocketType.Dgram, 0)) {
                socket.Connect("8.8.8.8", 65530);
                IPEndPoint endPoint = socket.LocalEndPoint as IPEndPoint;
                localIP = endPoint.Address.ToString();
            }

            WebServer ws = new WebServer(SendResponse, "http://" + localIP + ":" + PORT + "/");
            ws.Run();

            //labelDebugInfo.Content = "IP: " + localIP;
            dbgText[0] = "IP: " + localIP + ":" + PORT;
            dbgText[1] = "Face: null";
            updateDebugText();

            labelDebugInfo.Visibility = Visibility.Visible;
        }

        public string SendResponse(HttpListenerRequest request)
        {
            String toReturn = "<html>";
            toReturn += "<head>";

            toReturn += "<style>";

            //Black background
            toReturn += "html {background-color: black;}";

            //Rectangles
            toReturn += "a{width:100px;height:100px;float:left;margin:15px;font-weight:700}";

            //Always Blue Text
            toReturn += "a:link{color:#00f}a:visited{color:#00f}a:hover{color:#00ceff}a:active{color:#00f}";

            //Icon insult
            toReturn += ".icon-pumpkin {background: url('data:image/png;base64,') no-repeat; background-size: 100% 100%; }";

            //Icon Princess
            toReturn += ".icon-princess {background: url('data:image/png;base64,') no-repeat; background-size: 100% 100%;}";

            //Icon Halloween
            toReturn += ".icon-skull {background: url('data:image/png;base64,') no-repeat; background-size: 100% 100%;}";

            //Icon Pirate
            toReturn += ".icon-pirate {background: url('data:image/png;base64,') no-repeat; background-size: 100% 100%;}";

            //Icon Blank'
            toReturn += ".icon-blank {background: url('data:image/png;base64,') no-repeat; background-size: 100% 100%;}";

            //Icon Back
            toReturn += ".icon-back {background: url('data:image/png;base64,') no-repeat; background-size: 100% 100%; }";

            //Icon DebugText
            toReturn += ".icon-debugText {background: url('data:image/png;base64,') no-repeat; background-size: 100% 100%; }";

            //Icon Settings
            toReturn += ".icon-settings {background: url('data:image/png;base64,') no-repeat; background-size: 100% 100%; }";


            toReturn += "</style>";

            toReturn += "</head>";
            toReturn += "<body>";

            if (request.RawUrl.StartsWith("/play/")) {
                toReturn += "<a href=\"/\" class=\"icon-back\">Back</a>";
                toReturn += ResponcePlay(request);
            }
            else if (request.RawUrl.StartsWith("/settings/")) {
                toReturn += "<a href=\"/\" class=\"icon-back\">Back</a>";
                toReturn += ResponceSettings(request);
            }
            else {
                toReturn += ResponceMain(request);
            }

            toReturn += "</body>";
            toReturn += "</html>";

            return toReturn;
        }

        private String ResponceMain(HttpListenerRequest request)
        {
            String toReturn = "";

            toReturn += "<a href=\"/play/\" class=\"icon-princess\">Faces</a>";
            toReturn += "<a href=\"/settings/\" class=\"icon-settings\">Settings</a>";

            return toReturn;
        }

        private String ResponceSettings(HttpListenerRequest request)
        {
            string theSetting = request.RawUrl.Substring(10);

            this.Dispatcher.Invoke(delegate {
                if (theSetting == "debugText/") {
                    labelDebugInfo.Visibility = ToggleVisibility(labelDebugInfo.Visibility);
                }
            });

            String toReturn = "";

            toReturn += "<a href=\"/settings/debugText/\" class=\"icon-debugText\">Debug Text</a>";

            return toReturn;
        }

        private String ResponcePlay(HttpListenerRequest request)
        {

            if (request.RawUrl.StartsWith("/play/movie/")) {
                string theMovie = request.RawUrl.Substring(12);
                this.Dispatcher.Invoke(delegate {
                    PlayMovie(theMovie);
                });
            }


            String toReturn = "";

            for (int i = folders.Count - 1; i >= 0; i--) {
                var item = folders.ElementAt(i);
                String itemKey = item.Key;
                List<String> itemValue = item.Value;
                foreach (String movie in itemValue) {

                    String iconClass = "icon-" + itemKey;

                    if (!iconClass.Contains("tts") && !iconClass.Contains("tss") && !iconClass.Contains("lipsync") && !iconClass.Contains("old") && !iconClass.Contains("black")) {
                        toReturn += "<a href=\"/play/movie/" + itemKey + "/" + movie + "\" class=" + iconClass + ">" + movie + "</a>";
                    }
                }
            }

            return toReturn;
        }

        void PlayMovie(string name)
        {
            mediaElement.LoadedBehavior = MediaState.Manual;
            mediaElement.Source = new Uri(System.IO.Path.GetFullPath("movies\\" + name + ".mp4"));
            mediaElement.Visibility = Visibility.Visible;
            mediaElement.Play();
            dbgText[1] = "Face: " + "movies\\" + name + ".mp4";
            updateDebugText();
        }

        private Visibility ToggleVisibility(Visibility visibility)
        {
            return visibility == Visibility.Visible ? Visibility.Collapsed : Visibility.Visible;
        }

        private void mediaElement_MediaEnded(object sender, RoutedEventArgs e)
        {
            mediaElement.Visibility = Visibility.Hidden;
        }

        private void Window_KeyDown(object sender, KeyEventArgs e)
        {
            if (e.Key == Key.Escape) {
                this.Close();
            }
        }

        private void updateDebugText()
        {
            String toPrint = "";
            for(int i = 0; i < dbgText.Length; i++) {
                toPrint += dbgText[i] + "\r\n";
            }
            labelDebugInfo.Content = toPrint;
        }

        //TODO: Long run this might not be nessessarry (Button)
        private void Window_Loaded(object sender, RoutedEventArgs e)
        {
            //Second monitor
            this.WindowStartupLocation = WindowStartupLocation.Manual;
            this.WindowState = WindowState.Normal;

            var screen = System.Windows.Forms.Screen.AllScreens[1];
            var workingArea = screen.WorkingArea;
            this.Left = workingArea.Left;
            this.Top = workingArea.Top;
            this.Width = workingArea.Width;
            this.Height = workingArea.Height;

            //Nice shitty bug workaround : https://stackoverflow.com/questions/4189660/why-does-wpf-mediaelement-not-work-on-secondary-monitor
            var hwndSource = PresentationSource.FromVisual(this) as HwndSource;
            if (hwndSource != null) {
                var hwndTarget = hwndSource.CompositionTarget;
                if (hwndTarget != null) hwndTarget.RenderMode = RenderMode.SoftwareOnly;
            }

        }
        //TODO: Long run this might not be nessessarry (Button)
        private void Window_ContentRendered(object sender, EventArgs e)
        {
            this.WindowState = WindowState.Maximized; //Second monitor
        }
    }
}
